                for (var j = 0, k = icons.length; j < k; j++) {
                    if (icons[j][1].indexOf(val) !== -1) {
                        $('#icon-' + icons[j].join('-')).removeClass('d-none').addClass('d-inline-flex');
                    }
                }
            });
        });
    </script>
@endsection
